function matchCate(t) {
  /*匹配2级分类*/
  for (var pattern in categoryDict1) {
    if (t.indexOf(pattern) > -1) {
      return categoryDict1[pattern];
    }
  }

  /*二级分类未匹配到，匹配一级分类*/
  for (var pattern in categoryDict2) {
    if (t.indexOf(pattern) > -1) {
      setTariff2(pattern);
      return;
    }
  }
  return false;
}

